--To create student table

CREATE TABLE Student(
   student_id            VARCHAR(5) NOT NULL PRIMARY KEY
  ,name                  VARCHAR(11) NOT NULL
  ,level                 VARCHAR(3) NOT NULL
  ,gender                VARCHAR(6) NOT NULL
  ,enrollment_type       VARCHAR(12) NOT NULL
  ,session               VARCHAR(9) NOT NULL
  ,attendance_percentage VARCHAR(5) NOT NULL
  ,cgpa                  VARCHAR(4) NOT NULL
);


--TO CREATE COURSE TABLE
CREATE TABLE course(
   course_id    VARCHAR(4) NOT NULL PRIMARY KEY
  ,course_code  DATE  NOT NULL
  ,course_title DATE  NOT NULL
  ,level        INTEGER  NOT NULL
  ,semester     VARCHAR(6) NOT NULL
  ,lecturer_id  VARCHAR(4) NOT NULL
  ,time_slot    VARCHAR(4) NOT NULL
);

---To create lecturer table
CREATE TABLE Lecturer(
   lecturer_id     VARCHAR(4) NOT NULL PRIMARY KEY
  ,name            VARCHAR(11) NOT NULL
  ,rank            VARCHAR(15) NOT NULL
  ,department      VARCHAR(16) NOT NULL
  ,courses_offered VARCHAR(1) NOT NULL
);


--To Create Attendance Table
CREATE TABLE Attendance(
   student_id VARCHAR(5) NOT NULL PRIMARY KEY
  ,course_id  VARCHAR(4) NOT NULL
  ,day        VARCHAR(9) NOT NULL
  ,attended   VARCHAR(3) NOT NULL
);

--TO Create a Enrollment table
CREATE TABLE Enrollment(
   student_id      VARCHAR(5) NOT NULL PRIMARY KEY
  ,course_id       VARCHAR(4) NOT NULL
  ,semester        VARCHAR(6) NOT NULL
  ,session         VARCHAR(9) NOT NULL
  ,enrollment_type VARCHAR(12) NOT NULL
);


--To create a Grade table
CREATE TABLE Grade(
   student_id            VARCHAR(5) NOT NULL PRIMARY KEY
  ,name                  VARCHAR(11) NOT NULL
  ,level                 VARCHAR(3) NOT NULL
  ,gender                VARCHAR(6) NOT NULL
  ,enrollment_type       VARCHAR(12) NOT NULL
  ,session               VARCHAR(9) NOT NULL
  ,attendance_percentage NUMERIC(5,2) NOT NULL
  ,cgpa                  NUMERIC(4,2) NOT NULL
);
